import React from "react";

export default function Navbar(){
    return(
        <nav onScroll={ $(window).scroll(function() {
            if ($(window).scrollTop()) {
                $('nav').addClass('black');
            } else {
                $('nav').removeClass('black');
            }
        })}>
           
           <span className="logo">Logo</span>
           <ul>
            <li>Home</li>
            <li>Services</li>
            <li>About</li>
           </ul>
            
        </nav>
    )
}
